â–ªï¸ First, what do we mean by the term â€œinjectableâ€? This is a broad term encompassing three main categories of treatments done through injections typically to the face. The categories are neuromodulators (Botox is the most common one in this category, but there are others), dermal fillers, and fat dissolving treatments (Kybella)

â–ªï¸ How do Botox and other neuromodulators (e.g. Xeomin, Dysport, Jeuveau, and a soon-to-be released product from Revance) work? These products work by blocking nerve signals in the muscles where they are injected, thus reducing/eliminating movement of the muscles and associated wrinkles in the area.

â–ªï¸ How are dermal fillers used? Different substances are used in different fillers, with the overall goal to add volume and fullness. The most commonly used areas for fillers are the lips, cheeks, and creases around the mouth. 

â–ªï¸ What is Kybella? Kybella is made of deoxycholic acid, which basically dissolves small areas of fat. Itâ€™s primarily used for under the chin, but can be used in other areas as well.

â–ªï¸ Are these procedures safe? As with any treatment, a full medical evaluation is needed to ensure the safety of a specific procedure for you and to review the risks. But overall risks are very low in experienced hands, with millions of injectable procedures performed every year and a strong safety record.

